export const actionType = { FETCH_DATA: "FETCH DATA" };

function fetchData(comments) {
  return {
    type: "FETCH_DATA",
    payload: comments
  };
}
// DISPATCHE
export function fetchDataDispatch(payload) {
  return dispatch => {
    dispatch(fetchData(payload));
  };
}
